#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT getUnmaskedClientAddressesSignalError(output, error_type, error_str);
        Q_EMIT getUnmaskedClientAddressesSignalErrorFull(worker, error_type, error_str);
